asyNavHome:{fr:"Découvrez nos produits phares et les catégories populaires.",en:"Discover our featured products and popular categories."},easyNavCategories:{fr:"Parcourez toutes nos catégories de produits de manière organisée.",en:"Browse all our product categories in an organized way."},easyNavCart:{fr:"Consultez les articles que vous avez ajoutés et passez à la caisse.",en:"Review the items you've added and proceed to checkout."},easyNavProfile:{fr:"Gérez vos informations, consultez votre historique de commandes et personnalisez l'apparence.",en:"Manage your information, view your order history, and customize the appearance."},smartSearch:{fr:"2. Recherche Intelligente",en:"2. Smart Search"},smartSearchDesc:{fr:`Utilisez la barre de recherche sur la page d'accueil. Vous pouvez taper un nom de produit, un symptôme (<strong class='text-app-primary/80'>"peau sèche"</strong>, <strong class='text-app-primary/80'>"mal de tête"</strong>) ou un besoin général. Notre IA trouvera les produits les plus pertinents pour vous !`,en:`Use the search bar on the home page. You can type a product name, a symptom (<strong class='text-app-primary/80'>"dry skin"</strong>, <strong class='text-app-primary/80'>"headache"</strong>), or a general need. Our AI will find the most relevant products for you!`},powerfulFiltering:{fr:"3. Filtrage Puissant",en:"3. Powerful Filtering"},powerfulFilteringDesc:{fr:`Dans une page de catégorie, utilisez les filtres manuels pour affiner par marque, type, etc. Pour une expérience sur mesure, cliquez sur <strong class='text-app-primary/80'>"Filtre IA"</strong> et décrivez ce que vous cherchez en langage naturel (ex: <em class='text-app-text-primary/80'>"la crème la moins chère pour peau sensible"</em>). L'IA analysera votre demande et vous proposera les meilleurs produits, même s'ils sont dans une autre catégorie !`,en:`On a category page, use the manual filters to refine by brand, type, etc. For a tailored experience, click on <strong class='text-app-primary/80'>"AI Filter"</strong> and describe what you are looking for in natural language (e.g., <em class='text-app-text-primary/80'>"the cheapest cream for sensitive skin"</em>). The AI will analyze your request and suggest the best products, even if they are in another category!`},themeCustomization:{fr:"4. Personnalisation du Thème",en:"4. Theme Customization"},themeCustomizationDesc:{fr:`Dans votre Profil, allez dans <strong class='text-app-primary/80'>"Apparence"</strong>. Basculez entre le mode clair et sombre, ou pour une touche unique, utilisez le générateur de thème par IA. Décrivez une ambiance (ex: <em class='text-app-text-primary/80'>"un thème océanique apaisant"</em>) et laissez l'IA créer une palette de couleurs et des polices personnalisées !`,en:`In your Profile, go to <strong class='text-app-primary/80'>"Appearance"</strong>. Switch between light and dark mode, or for a unique touch, use the AI theme generator. Describe a mood (e.g., <em class='text-app-text-primary/80'>"a soothing ocean theme"</em>) and let the AI create a custom color palette and fonts for you!`},profileManagement:{fr:"5. Gestion du Profil",en:"5. Profile Management"},profileManagementDesc:{fr:`Cliquez sur <strong class='text-app-primary/80'>"Améliorer le Profil"</strong> pour ajouter vos informations. En renseignant votre nom, notre IA essaiera même de vous attribuer un avatar personnalisé ! Consultez aussi votre historique de commandes pour revoir vos achats passés.`,en:`Click on <strong class='text-app-primary/80'>"Improve Profile"</strong> to add your information. By entering your name, our AI will even try to assign you a personalized avatar! Also, check your order history to review your past purchases.`},enjoyShopping:{fr:"Profitez de votre shopping !",en:"Enjoy your shopping!"},chatInitialMsg:{fr:"Bonjour, je suis Dr. Mariam. Posez-moi une question ou utilisez une action rapide ci-dessous.",en:"Hello, I am Dr. Mariam. Ask me a question or use a quick action below."},chatServi